webpackJsonp([0xf106b8e96bb1],{1499:function(a,e){a.exports={data:{markdownRemark:{html:"<p>天安門広場まで徒歩でお出かけください。ここにお祝いの雰囲気があり、国民の日が来ています。天安門は改装され、赤い壁が塗装されました。若いパイオニアたちは金水川のほとりに立っていた。</p>\n<p>広場には大きな変化があり、広場の真ん中に大きな緑色の帯が形成されています。東は花の龍、西は鳳凰、背は花の塔で、船の模型は「海の世界」と呼ばれています。たくさんの人が広場に集まり、光を当て、写真を撮り、見ていました。長安街の巨大なスローガンが設定され、国旗が風に吹かれました。共和国の誕生日が来ています。</p>",id:"/home/swain/workspace/political-life/src/pages/ja/0147.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ja/0147.md",frontmatter:{title:"9月24日 土曜日"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ja/0147.md absPath of file >>> MarkdownRemark"}}}});
